import '.././styles/header.css'

export default function Header() {
    return (

        <div className='headerContainer'>
            <h1>Martín Osan</h1>
            <h2>Estudiante de Ingeniería en Informática</h2>   
            <p>
              Construí esta pagina web con el objetivo de mostrar algunos de mis proyectos. <br></br> Si bien me siento más orientado al desarrollo backend,
        terminé disfrutando mucho el proceso de diseño del front, cosa que sinceramente no me esperaba. <br></br> Estoy muy contento con el resultado porque me parece que quedó lindo y además aprendí mucho en el proceso.<br></br> 
        Arriba están los links de mi perfiil de github, de linkedin y mi curriculum.
        ¡Muchas gracias por visitar!
            </p>
        </div>
    );
}
